webpackJsonp([0x8126aad6d458],{5121:function(t,e){t.exports={data:{post:{html:"<p>Mama hasn't written anything for PapaScott yet, but she has been busy taking pictures for <a href=\"http://albums.photopoint.com/j/AlbumList?u=185392\">PhotoPoint</a>. We made it easier for her to send pictures there by putting the account in her name. She can now send the pictures in via E-mail direct from the camera, and PhotoPoint automatically resizes the files. It wastes lots of bandwidth, but is much easier to work with.</p>\n<p>Christopher is now bending his knees when he lays on his stomach. He just has to get his butt a little higher, and he'll be crawling!</p>",fields:{title:"PhotoPoint",date:"04 Aug 2000",url:"https://papascott.de/2000-08-04-photopoint/"}}},pathContext:{slug:"/2000-08-04-photopoint/",prev:{fields:{title:"Thursday",date:"03 Aug 2000",slug:"/2000-08-03-thursday/"}},next:{fields:{title:"Laid-up Layout",date:"05 Aug 2000",slug:"/2000-08-05-laid-up-layout/"}}}}}});
